"use strict";

$(document).ready(function() {
    $.ajax({
        method: "POST",
        url: "/request"
    }).done(function(t) {
        for (var s in t) $(".result").append("\n\t\t\t\t\t<div class='result__line'>\n\t\t\t\t\t\t<div class='result__column'>" + t[s].Imei + "</div>\n\t\t\t\t\t\t<div class='result__column'>" + t[s].CurrentDateTime + "</div>\n\t\t\t\t\t\t<div class='result__column'>" + t[s].GPSDateTime + "</div>\n\t\t\t\t\t\t<div class='result__column'>" + t[s].Datatype + "</div>\n\t\t\t\t\t\t<div class='result__column'>" + t[s].Address + "</div>\n\t\t\t\t\t\t<div class='result__column'>" + t[s].Distance + "</div>\n\t\t\t\t\t</div>\n\t\t\t\t");
    });
});